<script type="text/html" id="ul-template">

            </li>
            <ul class="UL_LIST">

                        </span>
                    </a> {{N}}   - 
                    {{> song}}
                </li>
                {{/songs}}
            </ul>
        </ol>
    {{/folder}}
</script>
